Hello Donald, to incorporate functionality within the `DateRange` class that handles events on specific days of the week, such as every Monday and Wednesday, you'd want to update the `Frequency` enumeration to include an option for custom weekly occurrences and add a property to store the specific days of the week on which the event should occur. Here's how you could extend the `Frequency` enumeration and modify the `DateRange` class in Swift:

```swift
import Foundation

// Extending the Frequency enum to support specific days of the week.
enum Frequency {
    case daily
    case weekly(Set<Weekday>)
    case monthly
    case yearly
}

enum Weekday: Int {
    case sunday = 1, monday, tuesday, wednesday, thursday, friday, saturday

    func toDateComponents() -> DateComponents {
        return DateComponents(weekday: self.rawValue)
    }
}

class DateRange {
    let start: Date
    let end: Date
    var frequency: Frequency?

    init(start: Date, end: Date, frequency: Frequency? = nil) {
        self.start = start
        self.end = end
        self.frequency = frequency
    }

    func nextOccurrence(after date: Date) -> Date? {
        let calendar = Calendar.current

        guard let frequency = self.frequency else {
            return nil
        }

        switch frequency {
        case .daily:
            return calendar.date(byAdding: .day, value: 1, to: date)
        case .weekly(let weekdays):
            var nextDate: Date? = date
            var found = false
            while !found {
                guard let increasedDate = calendar.date(byAdding: .day, value: 1, to: nextDate!) else { break }
                nextDate = increasedDate
                let weekdayComponent = calendar.component(.weekday, from: nextDate!)
                found = weekdays.contains(Weekday(rawValue: weekdayComponent)!)
            }
            return nextDate
        case .monthly:
            return calendar.date(byAdding: .month, value: 1, to: date)
        case .yearly:
            return calendar.date(byAdding: .year, value: 1, to: date)
        }
    }
}

// Usage example for Monday and Wednesday occurrences:
let dateFormatter = DateFormatter()
dateFormatter.dateFormat = "yyyy/MM/dd"

let startDate = dateFormatter.date(from: "2001/06/13")!
let dateRange = DateRange(start: startDate, end: startDate, frequency: .weekly([.monday, .wednesday]))

if let nextMondayOrWednesday = dateRange.nextOccurrence(after: startDate) {
    print("The next occurrence on a Monday or Wednesday is: \(dateFormatter.string(from: nextMondayOrWednesday))")
}
```

This code introduces a `Weekday` enum to represent specific days of the week and a `Set<Weekday>` within the `weekly` case of the `Frequency` enum that allows the `DateRange` instance to store the days when the event should recur. The `nextOccurrence` method is updated to compute the next occurrence date that falls on one of the specified weekdays. Please note, for usage in a real application, consider additional checks for event end dates and other corner cases as appropriate.

