Good morning, Jesse. The logical error is in the image sources for the "then" and "now" images. The "then" image should have the source "now.jpg" and the "now" image should have the source "then.jpg". Here is the corrected code:
<!DOCTYPE html>
<html>
<body>
<h2>Photography: Then and Now</h2>
<img src="now.jpg" alt="Now" style="width:50%; height:50%;">
<img src="then.jpg" alt="Then" style="width:50%; height:50%;">
<p>Use the slider to see the difference:</p>
<input type="range" min="0" max="1" value="0.5" step="0.01" id="slider">
<script>
var slider = document.getElementById("slider");
var then = document.getElementsByTagName("img")[1];
var now = document.getElementsByTagName("img")[0];
slider.oninput = function() {
  then.style.width = (1 - this.value) * 100 + "%";
  now.style.width = this.value * 100 + "%";
}
</script>
</body>
</html>

sent2:
In the JavaScript code provided, the logical error seems to be in the way the `img` elements are selected. The `getElementsByTagName` method returns a live HTMLCollection of elements with the given tag name, and the indexes for selecting the "then" and "now" images appear to be swapped. Assuming that the first `img` element (index 0) in the HTML corresponds to the "Then" image and the second `img` element (index 1) to the "Now" image, the JavaScript should select the images like this:

```javascript
var then = document.getElementsByTagName("img")[0];
var now = document.getElementsByTagName("img")[1];
```

So the corrected JavaScript code would be:

```javascript
<script>
var slider = document.getElementById("slider");
var then = document.getElementsByTagName("img")[0];
var now = document.getElementsByTagName("img")[1];
slider.oninput = function() {
  then.style.width = (1 - this.value) * 100 + "%";
  now.style.width = this.value * 100 + "%";
}
</script>
```

With this change, the slider should correctly adjust the width of both images to reflect the difference between "Then" and "Now" as intended.
